"use strict";var quotes=require("../quotes.json"),functions=require("../functions"),_require=require("../config.json"),default_color=_require.default_color;module.exports={name:"quote",description:"Sends a quote from Jotaro.",cooldown:1,guildOnly:!1,execute:function(e){var o,r=functions.getRandom(quotes.series[0].arc.length),n=quotes.series[0].arc[r];for(var t in n)o=t;var u=functions.getRandom(n[o].length),i=n[o][u];e.channel.send("",{embed:{description:'*"'+i.quote+'"*\n\n - '+i.description+"\nVolume "+i.vol+", Chapter "+i.ch+": *"+o+"*, part "+i.part,color:functions.convertColor(default_color)}})}};